INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (2877, 6693, 'Levomilnacipran', 'Hypertension', 'Selective serotonin and norepinephrine reuptake inhibitor antidepressants (SNRIs) have been associated with sustained increases in blood pressure.  Therapy with SNRI antidepressants should be administered cautiously in patients with preexisting hypertension.  Blood pressure should be assessed prior to initiating treatment and monitored regularly.  The dose should be reduced or discontinued if necessary.', '2', '', 'DDInter', 0);
